// File: ACFillingVF1.js

import React, { useState } from "react";
import axios from "axios";
import "./FormStyles.css";

function ACFillingVF1() {
  const [formData, setFormData] = useState({
    AC_VIN: "",
    AC_Pressure_Actual: "",
    AC_Pressure_Prefill_Actual: "",
    AC_Pressure_Decay: "",
    AC_Vacuum_Actual: "",
    AC_Vacuum_Actual_Time: "",
    AC_Leak_Vacuum_Actual: "",
    AC_Leak_Vacuum_Result: "",
    AC_Leak_Vacuum_Actual_Time: "",
    AC_Vacuum2_Actual: "",
    AC_Vacuum2_Actual_Time: "",
    AC_Filling_Quantity_Actual: "",
    AC_Filling_Time_Actual: "",
    AC_Cycle_Time_Actual: "",
    AC_RESULT: "",
  });

  const [submitted, setSubmitted] = useState(false);

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      await axios.post("http://localhost:5000/submit/acfilling-vf1", formData);
      setSubmitted(true);
    } catch (error) {
      alert("Submission failed!");
      console.error(error);
    }
  };

  return (
    <div className="form-container">
      <h2>VF1 - AC Filling Form</h2>
      {submitted && (
        <p className="success-msg">âœ… Data submitted successfully!</p>
      )}
      <form onSubmit={handleSubmit}>
        <div>
          <label>VIN</label>
          <input
            type="text"
            name="AC_VIN"
            value={formData.AC_VIN}
            onChange={handleChange}
            required
          />
        </div>
        <div>
          <label>Pressure Actual</label>
          <input
            type="text"
            name="AC_Pressure_Actual"
            value={formData.AC_Pressure_Actual}
            onChange={handleChange}
            required
          />
        </div>
        <div>
          <label>Pressure Prefill Actual</label>
          <input
            type="text"
            name="AC_Pressure_Prefill_Actual"
            value={formData.AC_Pressure_Prefill_Actual}
            onChange={handleChange}
            required
          />
        </div>
        <div>
          <label>Pressure Decay</label>
          <input
            type="text"
            name="AC_Pressure_Decay"
            value={formData.AC_Pressure_Decay}
            onChange={handleChange}
            required
          />
        </div>
        <div>
          <label>Vacuum Actual</label>
          <input
            type="text"
            name="AC_Vacuum_Actual"
            value={formData.AC_Vacuum_Actual}
            onChange={handleChange}
            required
          />
        </div>
        <div>
          <label>Vacuum Actual Time</label>
          <input
            type="text"
            name="AC_Vacuum_Actual_Time"
            value={formData.AC_Vacuum_Actual_Time}
            onChange={handleChange}
            required
          />
        </div>
        <div>
          <label>Leak Vacuum Actual</label>
          <input
            type="text"
            name="AC_Leak_Vacuum_Actual"
            value={formData.AC_Leak_Vacuum_Actual}
            onChange={handleChange}
            required
          />
        </div>
        <div>
          <label>Leak Vacuum Result</label>
          <input
            type="text"
            name="AC_Leak_Vacuum_Result"
            value={formData.AC_Leak_Vacuum_Result}
            onChange={handleChange}
            required
          />
        </div>
        <div>
          <label>Leak Vacuum Actual Time</label>
          <input
            type="text"
            name="AC_Leak_Vacuum_Actual_Time"
            value={formData.AC_Leak_Vacuum_Actual_Time}
            onChange={handleChange}
            required
          />
        </div>
        <div>
          <label>Vacuum2 Actual</label>
          <input
            type="text"
            name="AC_Vacuum2_Actual"
            value={formData.AC_Vacuum2_Actual}
            onChange={handleChange}
            required
          />
        </div>
        <div>
          <label>Vacuum2 Actual Time</label>
          <input
            type="text"
            name="AC_Vacuum2_Actual_Time"
            value={formData.AC_Vacuum2_Actual_Time}
            onChange={handleChange}
            required
          />
        </div>
        <div>
          <label>Filling Quantity Actual</label>
          <input
            type="text"
            name="AC_Filling_Quantity_Actual"
            value={formData.AC_Filling_Quantity_Actual}
            onChange={handleChange}
            required
          />
        </div>
        <div>
          <label>Filling Time Actual</label>
          <input
            type="text"
            name="AC_Filling_Time_Actual"
            value={formData.AC_Filling_Time_Actual}
            onChange={handleChange}
            required
          />
        </div>
        <div>
          <label>Cycle Time Actual</label>
          <input
            type="text"
            name="AC_Cycle_Time_Actual"
            value={formData.AC_Cycle_Time_Actual}
            onChange={handleChange}
            required
          />
        </div>
        <div>
          <label>Result</label>
          <input
            type="text"
            name="AC_RESULT"
            value={formData.AC_RESULT}
            onChange={handleChange}
            required
          />
        </div>
        <button type="submit">Submit</button>
      </form>
    </div>
  );
}

export default ACFillingVF1;
